import React from 'react'

const ImageCard = (props) => {
    // const clickhandler=()=>{
    //     console.log(props.name)
    // }
    return (
        <div>
            <div className="imagecard">
                <img className="ima" src={props.url} alt=""  ></img>
                <div className="hide">
                    {props.name}
                    <button>button</button>
                </div>
            </div>

        </div>

    )
}

export default ImageCard
